function Home(){
    return (
        <>
            <div id="Home" class="home">
                <div>
                    <h1>Manar Elbeshbishy</h1>
                </div>
                <div>
                    <button><a href="#about">About</a></button>
                    <button>Projects</button>
                    <button>Education</button>
                    <button>Contact</button>
                </div>
                
            </div>
        </>
    );
}
export default Home;
